import React, { Component } from 'react';
import '../App.css';


class About extends Component {
  render() {
    return (

      <div >


<div class="container-fluid c" id="aboutdiv">

<div class ="row" id="rowheading">
<div class="col">
<p class="text-left" id="helloheading2">About Me</p>
<p class="text-left" id="firstpara">trying to get my life together! :)</p>
</div>
</div>
<div class ="row" id="rowheading">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">

</div>
</div>

<div class ="row" id="rowsingleline">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara"> <br/> 4434 S.Himalaya Cr. <br/> Aurora, Colorado </p>
</div>
</div>
<div class="container" id="footer">  </div>
</div>
      </div>
    );
  }
}

export default About;
